import React from "react";

const Services = () => {
  return (
    <section className="services section" id="services">
      <h2 className="section__title">Our Expertise</h2>
      <span className="section__subtitle">Expertise at Your Service</span>
      .services__container
    </section>
  );
};

export default Services;
